import 'package:ieca_mobile/_import.dart';

class CoHymnsKuhalisa {
  static List<HymnsContent> list = [
    HymnsContent(id: 3600, position: 1, content: "Tuhalisenu mwe Zambi,\nMukwa kusolola vumbi;\nTata, tumuhalisenu,\nNi Mwana ni mwe Spiritu.", hymnsNumber: CoHymnsNumberSeeder.KUHALISA_1, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3601, position: 1, content: "Eswe twanyingika Yesu,\nHamwe tumuhalisenu;\nChatutamba kumusela\nMbunge ni yeswe.", hymnsNumber: CoHymnsNumberSeeder.KUHALISA_2, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3602, position: 2, content: "Tuchimufumanyisenu,\nYeswe kakutuhashisa;\nKutuchi kahona, kachi\nTwamufuliela.", hymnsNumber: CoHymnsNumberSeeder.KUHALISA_2, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3603, position: 3, content: "Fulielenu miaka yeswe,\nIye keshi kwalumuka;\nKechi kulihandununa\nNo, wakwafwila.", hymnsNumber: CoHymnsNumberSeeder.KUHALISA_2, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3604, position: 4, content: "A Mwene, tukwase kama,\nHanga tukulalaminye,\nNdo yetu mutuliwana\nNi Yena mwilu.", hymnsNumber: CoHymnsNumberSeeder.KUHALISA_2, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3605, position: 5, content: "Yeswe twafupa musono,\nTwayivwila usona hano;\nNdo muyitusolokela,\nMba mutuhinga.", hymnsNumber: CoHymnsNumberSeeder.KUHALISA_2, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3606, position: 1, content: "Tuhalisenu Zambi Tata yetu,\nWechele ku kufwa \nMwanenyi Yesu.", hymnsNumber: CoHymnsNumberSeeder.KUHALISA_3, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3607, content: "Aleluya! Ufumane!\nAleluya! Amen\nAleluya! Ufumane! Tuhuzulule.", hymnsNumber: CoHymnsNumberSeeder.KUHALISA_3, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3608, position: 2, content: "Tuhalisenu Spilitu ya pangu,\nYoze watunyingikishine \nMwe Kristu.", hymnsNumber: CoHymnsNumberSeeder.KUHALISA_3, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3609, position: 3, content: "Tuhalisenu Tata yetu Zambi,\nYoze watufupile \nNi vumbi lienyi.", hymnsNumber: CoHymnsNumberSeeder.KUHALISA_3, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3610, position: 4, content: "Tuhalisenu Mwana Zambi, yoze\nNi manyinga jenyi \nHatupenesa pe.", hymnsNumber: CoHymnsNumberSeeder.KUHALISA_3, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3611, position: 5, content: "Tuzalise to ni kuzanga, Mwene;\nMbunge jetu ni kahia \nMwilu jiwike.", hymnsNumber: CoHymnsNumberSeeder.KUHALISA_3, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3612, position: 6, content: "Muhalisenu, yenu kule jenyi;\nNgwenyi ngwo, \nKumungwizaho nikawashi.", hymnsNumber: CoHymnsNumberSeeder.KUHALISA_3, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3613, position: 1, content: "Zambi ya mbwika, \nSamatanga mwilu\nYinatukomwesa yitanga ye!\nYena wakwendesa matongonoshi,\nNi wakuhenyamisa tangwa pe.", hymnsNumber: CoHymnsNumberSeeder.KUHALISA_4, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3614, content: "Ni woma wunji tunakomoka\nZambi yetu, unene we!\nAkwa fufuta tunakomoka\nKunanga cha ulemu we.", hymnsNumber: CoHymnsNumberSeeder.KUHALISA_4, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3615, position: 2, content: "Twakwivwa liji Lie lia lundunjila\nWatuma njaji ni mihenyo ye,\nVula malundumuka munji munji\nMalelwa nawa mu tetela pwi.", hymnsNumber: CoHymnsNumberSeeder.KUHALISA_4, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3616, position: 3, content: "Ni ha lushiho wakufunga mwono\nWa yuma yeswe mu musenge we.\nHa vumbi wakusokolwesa mafwo,\nYitemo nawa, hashi homu chau.", hymnsNumber: CoHymnsNumberSeeder.KUHALISA_4, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3617, position: 4, content: "Chikomokeso chinahiana yeswe\nChize wahanyine Yesu Mwane\nAkatufwile, yetu akwa kole\nAkatupwise pundu ana je.", hymnsNumber: CoHymnsNumberSeeder.KUHALISA_4, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3618, position: 1, content: "Mba tangwa lia che chiseke,\nMuze natongwele Mwene;\nMbunge yami, yilikwize,\nKuwaha chami, chinene!", hymnsNumber: CoHymnsNumberSeeder.KUHALISA_5, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3619, content: "Tangwa lia chiseke!\nSe Yesu wangukosele!\nYafumba ngulembe, ngule,\nNguwahe matangwa eswe.\nTangwa lia chiseke!\nSe Yesu wangukosele.", hymnsNumber: CoHymnsNumberSeeder.KUHALISA_5, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3620, position: 2, content: "Hakolesa we usendo,\nNiwenyi, Iye niwami;\nHanangukoko, ngukaule\nLie Liji lia Zambi yami.", hymnsNumber: CoHymnsNumberSeeder.KUHALISA_5, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3621, position: 3, content: "Haliapwa nahwima mbunge\nKuli Yesu nafuliela;\nChichi kukatuka kevwe,\nYiwape yenyi nguzuke.", hymnsNumber: CoHymnsNumberSeeder.KUHALISA_5, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3622, position: 1, content: "Maliji makukatuka,\nNi meso kanda ujika,\nMbunge kanda ukalisa,\nMusono mulilamwina?", hymnsNumber: CoHymnsNumberSeeder.KUHALISA_6, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3623, content: "Musono nyi? Musono nyi?\nMusono mulilamwina?\nMusono nyi? Musono nyi?\nMusono mulilamwina?", hymnsNumber: CoHymnsNumberSeeder.KUHALISA_6, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3624, position: 2, content: "Mba tangwa lia hamene nyi?\nKuhetako kwiji yena!\nChikalu mu kuliecha nji?\nMusono mulilamwina?", hymnsNumber: CoHymnsNumberSeeder.KUHALISA_6, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3625, position: 3, content: "Hano hashi kwawaha nyi?\nChiseke chakuhi nawa;\nK’ristu Chilamwina Iye,\nMusono mulilamwina?", hymnsNumber: CoHymnsNumberSeeder.KUHALISA_6, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3626, position: 4, content: "K’ristu kechi kulituna,\nKachi unazange mwono,\nMusono nyi muputuka?\nMusono mulilamwina?", hymnsNumber: CoHymnsNumberSeeder.KUHALISA_6, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3627, position: 1, content: "Spilitu, ni pangu lie\nKu mbunge nguwahise;\nKwalajala chinyisa,\nNguzalise ni mwalwa.", hymnsNumber: CoHymnsNumberSeeder.KUHALISA_7, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3628, position: 2, content: "Spilitu, ni tachi je\nUkangutakamise;\nNgunalele, ngukwase,\nHanga ngukajikize.", hymnsNumber: CoHymnsNumberSeeder.KUHALISA_7, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3629, position: 3, content: "Spilitu, ni chiseke\nChinyengo unguchize;\nNgukwimbile musono,\nMumu wangwaha mwono.", hymnsNumber: CoHymnsNumberSeeder.KUHALISA_7, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3630, position: 4, content: "Spilitu, ngutomese\nKu shili ni uhenge;\nHanga ngukulingile,\nChipwe ku miaka yeswe.", hymnsNumber: CoHymnsNumberSeeder.KUHALISA_7, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3631, position: 1, content: "Yesu kakungusongwela,\nChika munguchihona?\nChichi kumuyambashana,\nMumu kanashishika.\nSambukila muli Iye,\nYa kwilu kunazuka,\nMumu chipwe mu luyinda\nYesu kakungukwasa.", hymnsNumber: CoHymnsNumberSeeder.KUHALISA_8, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3632, position: 2, content: "Yesu kakungusongwela,\nKakungulembejeka;\nKakungwaha vumbi lienyi,\nMbolo ya mwono nawa.\nKachi pwila ya mu mbunge\nMungwivwa, mangunwisa,\nMeya aze kechi kahwa\nNdo ku miaka ni miaka", hymnsNumber: CoHymnsNumberSeeder.KUHALISA_8, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3633, position: 3, content: "Yesu kakungusongwela,\nZango lienyi linene;\nWashikile kungutwala\nMwilu hamwe ni Mwene.\nMuze munguheta kuze\nKu uhenya wenyi pe,\nMungwimbamba miaka yeswe,\n«Te wangusongwelele»", hymnsNumber: CoHymnsNumberSeeder.KUHALISA_8, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3634, position: 1, content: "Mwe Mukwa kungukula kwali,\nKumeza cheka hashi, ngwo\nChinyingi nasa mwono kuuli,\nMu kwoko lienyi tachi, ngu.", hymnsNumber: CoHymnsNumberSeeder.KUHALISA_9, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3635, content: "Chinyingi nasa Yesu kwali,\nKumeza hashi cheka, ngwo\nChinyingi nasa mwono kuuli,\nMu kwoko lienyi tachi, ngu.", hymnsNumber: CoHymnsNumberSeeder.KUHALISA_9, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3636, position: 2, content: "Chinyingi nasa kanajame,\nLiakola, Liji lia Mwene;\nChipwe kufwa muchinguheta,\nMungukamumona meso.", hymnsNumber: CoHymnsNumberSeeder.KUHALISA_9, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3637, position: 3, content: "Chinyingi nasa ha chihela,\nMuze yami mungutwama;\nMumu Iye kananguzange,\nKulutwe makangwijila.", hymnsNumber: CoHymnsNumberSeeder.KUHALISA_9, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3638, position: 1, content: "A Mwene, tunakufupu,\nKumeso je tufukame;\nTumisa kama misayo,\nHaliapwa utuwahise,", hymnsNumber: CoHymnsNumberSeeder.KUHALISA_10, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3639, position: 2, content: "Mba tunakusakuilila\nManyinga, e alemu te;\nO hanatukundamisa,\nTusangalise Jina lie.", hymnsNumber: CoHymnsNumberSeeder.KUHALISA_10, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3640, position: 3, content: "Hanatunjisa mwe mwilu,\nYuma ya hashi yisale;\nTwafupa kwivwa yeswe ye.\nKuzanga che ni vumbi lie.", hymnsNumber: CoHymnsNumberSeeder.KUHALISA_10, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3641, position: 4, content: "Ha huma lie akusele\nJe mbimbo, ngwe chipangula,\nNi moko je, ni lumbu lie, \nTunafupu kukumona.", hymnsNumber: CoHymnsNumberSeeder.KUHALISA_10, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3642, position: 1, content: "Yesu K’litu wafwile, \nAleluya!    \nHanga atulamwine, \nAleluya!\nMu fuka wapombele,  \nAleluya!\nMwene wahindukile \nAleluya!", hymnsNumber: CoHymnsNumberSeeder.KUHALISA_11, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3643, position: 2, content: "Mwaso twakumwimbila, \nAleluya!\nYesu mwe Mwanangana,   \nAleluya!\nHa kulusu wafwile,         \nAleluya!\nShili ayichijile, \nAleluya!", hymnsNumber: CoHymnsNumberSeeder.KUHALISA_11, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3644, position: 3, content: "Lamba watuvwilile, \nAleluya!\nChocho katulanwina,      \nAleluya!\nIye Swana ya Mwilu,      \nAleluya!\nMukwa uhenya mweYesu\nAleluya!", hymnsNumber: CoHymnsNumberSeeder.KUHALISA_11, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3645, position: 4, content: "Zambi twakuhalisa  \nAleluya!\nVumbi linji watwaha,     \nAleluya!\nTusakwilenu helu,  \nAleluya!\nTata, Mwana, Spiritu.        \nAleluya!", hymnsNumber: CoHymnsNumberSeeder.KUHALISA_11, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3646, position: 1, content: "Kasengo mupema Yesu,\nYe milonga yetu se,\nWalitwikileyo yeswe,\nHanga tuyishikise;\nKevwe twalilimbalimba,\nTwalitwika yilemu,\nMumu kutwatwalileyo\nKuli mwe Mwene wetu.", hymnsNumber: CoHymnsNumberSeeder.KUHALISA_12, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3647, position: 2, content: "Kachi chuma cha kuzeza,\nKachi luyinda mweka;\nYena, kanda ulinyenga,\nLweza Mwene we wika.\nWeka wakuhi ngwe Yesu,\nKutuchiza chinyengo;\nYeswe twakuyisa kenu,\nKuli Mwene twalayo.", hymnsNumber: CoHymnsNumberSeeder.KUHALISA_12, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3648, position: 3, content: "Kachi twalilimbalimba\nNi yilemu ya hashi,\nTwala ku Chiswamo chetu,\nYesu Iye Chikwashi,\nKachi akwenu makumbila,\nTwala kuli Mwene we;\nMoko jenyi makufunga,\nKumuwivwa chiseke,", hymnsNumber: CoHymnsNumberSeeder.KUHALISA_12, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3649, position: 1, content: "Yesu, kanda unguhiana,\nUngwivwe kama,\nSe akwo unatambula,\nKanda unguhiana.", hymnsNumber: CoHymnsNumberSeeder.KUHALISA_13, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3650, content: "Chilamwina,\nUngwivwe kama,\nSe akwo unatambula,\nKanda unguhiana.", hymnsNumber: CoHymnsNumberSeeder.KUHALISA_13, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3651, position: 2, content: "Ku chitwamo che cha vumbi,\nNgwambe, nguswame,\nNikulemba ungukwase,\nNgukufuliele.", hymnsNumber: CoHymnsNumberSeeder.KUHALISA_13, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3652, position: 3, content: "Ku ululi we natala,\nNgukundamise;\nHuzulula mbunge yami,\nUngulamwine.", hymnsNumber: CoHymnsNumberSeeder.KUHALISA_13, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3653, position: 4, content: "Yena, uhwimino wami,\nWe mwono pundu;\nNgwe Yena niumwe hashi,\nMba niumwe mwilu.", hymnsNumber: CoHymnsNumberSeeder.KUHALISA_13, typeStanza: HymnsContentCode.VERSE),

  ];
}